move.use:
function TestEffect() { }
TestEffect.prototype = new StatusEffect();
TestEffect.prototype.id = "TestEffect";
TestEffect.prototype.tick = function() {
	print(this.subject.name + " was hurt by the test!");
	this.subject.hp -= 10;
};
TestEffect.prototype.applyEffect = function() {
	print("Applying TestEffect to " + this.subject.name);
	return true;
};
TestEffect.prototype.modifier = function(field, user, target, move, critical) {
	if (user.name == "Smeargle") {
		return [1, 0.5, 5];
	}
	return null;
}

var status = new TestEffect();
status = target.applyStatus(user, status);
print(status.inducer.name);
